/**
 * @param {character[][]} grid
 * @return {number}
 */
var numIslands = function(grid) {
  let currentVerticalPosition = 0;
  let currentHorizontalPosition = 0;

  let islands = 0;
  let knownNodes = new Map()

  while(currentVerticalPosition <= grid.length - 1) {
    if (grid[currentVerticalPosition][currentHorizontalPosition] !== '0') {
      // check if current position isn't a part of some graph that has already been extracted
      if (!knownNodes.has(`${currentVerticalPosition}_${currentHorizontalPosition}`)) {
        // if that's unknown node, then that means that we've encountered an unknown island.
        // increment islands amount
        islands++;
        
        // extract full graph and store it to knownNodes map
        const graphNodes = traverseGraph(grid, currentVerticalPosition, currentHorizontalPosition);
        
        knownNodes = new Map([...knownNodes, ...graphNodes]);
      }
    }

    if (currentHorizontalPosition < grid[0].length - 1) {
      currentHorizontalPosition++;
      continue;
    }

    currentHorizontalPosition = 0;
    currentVerticalPosition++;
  }
  
  return islands;
};

function traverseGraph(grid, verticalIndex, horizontalIndex) {
  let queue = [[verticalIndex, horizontalIndex]];
  let graphNodes = new Map([[`${verticalIndex}_${horizontalIndex}`, true]]);

  while(queue.length > 0) {
    const [verticalIndex, horizontalIndex] = queue.shift();

    // Checking top neighbor
    if (isValidNeighbor(grid, verticalIndex - 1, horizontalIndex, graphNodes)) {
      queue.push([verticalIndex - 1, horizontalIndex]);
      graphNodes.set(`${verticalIndex - 1}_${horizontalIndex}`, true);
    }

    // Checking right neighbor
    if (isValidNeighbor(grid, verticalIndex, horizontalIndex + 1, graphNodes)) {
      queue.push([verticalIndex, horizontalIndex + 1]);
      graphNodes.set(`${verticalIndex}_${horizontalIndex + 1}`, true);
    }

    // Checking bottom neighbor
    if (isValidNeighbor(grid, verticalIndex + 1, horizontalIndex, graphNodes)) {
      queue.push([verticalIndex + 1, horizontalIndex]);
      graphNodes.set(`${verticalIndex + 1}_${horizontalIndex}`, true);
    }

    // Checking left neighbor
    if (isValidNeighbor(grid, verticalIndex, horizontalIndex - 1, graphNodes)) {
      queue.push([verticalIndex, horizontalIndex - 1]);
      graphNodes.set(`${verticalIndex}_${horizontalIndex - 1}`, true);
    }
  }

  return graphNodes;
}

function isValidNeighbor(grid, verticalIndex, horizontalIndex, knownNodes) {
  const verticalIndexLimit = grid.length - 1;
  const horizontalIndexLimit = grid[0].length - 1;
  
  if (verticalIndex < 0 || verticalIndex > verticalIndexLimit) {
    return false;
  }

  if (horizontalIndex < 0 || horizontalIndex > horizontalIndexLimit) {
    return false;
  }

  if (grid[verticalIndex][horizontalIndex] !== '1') {
    return false;
  }

  if (knownNodes.has(`${verticalIndex}_${horizontalIndex}`)) {
    return false;
  }

  return true;
}


